" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    How CGG repeats influence mutation status",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Maternal repeats",
"       </td>",
"       <td class=\"subtitle1\">",
"        Percent of offspring with expansion to full mutation (&gt;200 repeats)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        55-59",
"       </td>",
