var title_f8_60_9164="Vulvar lesion immunocompromise";
var content_f8_60_9164=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F57626&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=11\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F57626&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=11\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Vulvar lesions in immunocompromised patient populations",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Diagnosis",
"       </td>",
"       <td class=\"subtitle1\">",
"        Important characteristics in immunocompromised women",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        HIV",
"       </td>",
"       <td>",
"        Shallow, sharply demarcated painful ulcers. Diagnosis is made by serology or measurement of viral load. Biopsy is not useful as it will show only nonspecific changes.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        HSV",
"       </td>",
"       <td>",
"        Common cause for chronic, non-healing ulcers; super infection with CMV; culture or biopsy for diagnosis.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        CMV",
"       </td>",
"       <td>",
"        Large deep necrotic ulcers; rare; biopsy for diagnosis.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Condyloma",
"       </td>",
"       <td>",
"        Numerous, larger, more difficult to treat and more likely to recur; size and number may cause obstruction in perineum; clinical diagnosis may be augmented with biopsy.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Molluscum contagiosum (pox virus)",
"       </td>",
"       <td>",
"        Numerous, larger, not self-limited, distribution over entire body; form plaques as typical umbilicated papules coalesce; biopsy for diagnosis.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tinea cruris",
"       </td>",
"       <td>",
"        Uncommon in women; atypical&nbsp;patches with uniform scale extending to legs, buttocks, abdomen; hair follicles involvement with pustules; microscopy of scale sample with KOH.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Scabies",
"       </td>",
"       <td>",
"        Severe variant - Norwegian scabies - vast increase in quantity of mites; hyperkeratotic papules/plaques over entire body;nails thickened with crusting; microscopy of scale sample.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Psoriasis",
"       </td>",
"       <td>",
"        Typical appearance with more numerous sites and \"inverse\" distribution affecting the anogenital skin more commonly; more difficult to treat; diagnose clinically &plusmn; biopsy and by exclusion.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Giant aphthae",
"       </td>",
"       <td>",
"        Large (1-2 cm), deep, painful erosions/ulcers; biopsy/culture to exclude HSV.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     HIV: human immunodeficiency virus; HSV: herpes simplex virus; CMV: cytomegalovirus.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
