var title_f8_60_9165="Infectious arthritis child";
var content_f8_60_9165=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F75773&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F75773&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Infectious causes of arthritis/arthralgia in children",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Viruses",
"       </td>",
"       <td>",
"        Viral arthritis usually involves multiple small joints",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Varicella zoster virus (VZV)",
"       </td>",
"       <td class=\"sublist_other\">",
"        VZV may cause primary arthritis within several days of the onset of rash; monoarticular knee involvement is most common; varicella also may cause secondary bacterial arthritis by providing a portal of entry for Staphylococci or Streptococci",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Hepatitis B virus (HBV)",
"       </td>",
"       <td class=\"sublist_other\">",
"        10 to 25 percent of patients with HBV develop arthritis, usually during the prodromal stage; joints of hands and knees most often affected; may be associated with urticarial and maculopapular eruption",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Hepatitis C virus (HCV)",
"       </td>",
"       <td class=\"sublist_other\">",
"        2 to 20 percent of patients with HCV develop arthritis (evanescent or oligoarthritis)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Parvovirus",
"       </td>",
"       <td class=\"sublist_other\">",
"        Arthralgia or arthritis may accompany or follow the skin eruption; the knee is most commonly affected joint",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Rubella",
"       </td>",
"       <td class=\"sublist_other\">",
"        Joint symptoms develop within one week before or after the rash",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Rubella vaccine virus",
"       </td>",
"       <td class=\"sublist_other\">",
"        Joint symptoms develop approximately two weeks after vaccination",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Mumps virus",
"       </td>",
"       <td class=\"sublist_other\">",
"        Joint symptoms usually develop after the onset of parotitis",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"sublist1_start\" colspan=\"2\">",
"        Fungi",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        <em>",
"         Candida",
"        </em>",
"       </td>",
"       <td class=\"sublist_other\">",
"        May occur in neonates or immunocompromised children",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        <em>",
"         Histoplasma",
"        </em>",
"       </td>",
"       <td class=\"sublist_other\">",
"        Endemic to the eastern and central United States and Canada; exposure to bird droppings, bat guano",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        <em>",
"         Coccidiodes",
"        </em>",
"       </td>",
"       <td class=\"sublist_other\">",
"        Endemic to the southwestern United States, northern Mexico, parts of Central and South America",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        <em>",
"         Sporothrix schenckii",
"        </em>",
"       </td>",
"       <td class=\"sublist_other\">",
"        Present in soil, moss, and other organic material; may be inoculated into the skin or inhaled",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        <em>",
"         Blastomyces dermatitidis",
"        </em>",
"       </td>",
"       <td class=\"sublist_other\">",
"        Endemic in the southeastern and central states and Midwestern states bordering the Great Lakes",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Post-infectious arthritis or reactive arthritis",
"       </td>",
"       <td>",
"        Preceding episode of respiratory (group A streptococcus,",
"        <em>",
"         Neisseria meningitidis",
"        </em>",
"        ), gastrointestinal (eg,",
"        <em>",
"         Shigella",
"        </em>",
"        ,",
"        <em>",
"         Salmonella",
"        </em>",
"        ,",
"        <em>",
"         Campylobacter",
"        </em>",
"        ), or genitourinary infection (",
"        <em>",
"         Chlamydia trachomatis",
"        </em>",
"        ); may be associated conjunctivitis, uveitis, or rash; onset of joint inflammation &ge;7 days after acute infection; resolves without sequelae in 97 to 99 percent of cases; if obtained, synovial fluid WBC count&nbsp;usually is &lt;50,000 cells/microL",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Rheumatic fever",
"       </td>",
"       <td>",
"        Evanescent and migratory arthritis; extreme pain and limited range of motion, but minimal effusion or swelling",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <p>",
"     &nbsp;",
"    </p>",
"    <div class=\"footnotes\">",
"     WBC: white blood cell.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
